        wiki: "Los Angeles officially the City of Los Angeles and often known by its initials L.A., is the second-largest city in the United States after New York City, the most populous city in California, and the county seat of Los Angeles County. Situated in Southern California, Los Angeles is known for its mediterranean climate, ethnic diversity, sprawling metropolis, and as a major center of the American entertainment industry. Los Angeles lies in a large coastal basin surrounded on three sides by mountains reaching up to and over 10,000 feet (3,000 m). Historically home to the Chumash and Tongva, Los Angeles was claimed by Juan Rodríguez Cabrillo for Spain in 1542 along with the rest of what would become Alta California. The city was officially founded on September 4, 1781, by Spanish governor Felipe de Neve. It became a part of Mexico in 1821 following the Mexican War of Independence. In 1848, at the end of the Mexican–American War, Los Angeles and the rest of California were purchased as part of the Treaty of Guadalupe Hidalgo, thereby becoming part of the United States. Los Angeles was incorporated as a municipality on April 4, 1850, five months before California achieved statehood. The city experienced rapid growth with the discovery of oil. The city is the focal point of the larger Los Angeles metropolitan area and the Greater Los Angeles Area region, which contain 13 million and over 18 million people, respectively, as of 2010, making it one of the most populous metropolitan areas in the world as well as the second-largest in the United States. Los Angeles is the seat of Los Angeles County, the most populated county in the United States. The city's inhabitants are referred to as Angelenos. Nicknamed the City of Angels, Los Angeles is a global city with a diverse economy in entertainment, culture, media, fashion, science, sports, technology, education, medicine and research. It has been ranked 6th in the Global Cities Index and 9th in the Global Economic Power Index. The city is home to renowned institutions covering a broad range of professional and cultural fields and is one of the most substantial economic engines within the United States. The Los Angeles combined statistical area (CSA) has a gross metropolitan product (GMP) of $831 billion (as of 2008), making it the third-largest in the world, after the Greater Tokyo and New York metropolitan areas. Los Angeles includes Hollywood and leads the world in the creation of television productions and recorded music; it is also one of the leaders in motion picture production. L.A. hosted the Summer Olympic Games in 1932 and 1984 and is currently bidding to host the 2024 Summer Olympics.",
